/*
 * Note:
 *
 * 1. The parameter `T` is guaranteed to be not empty.
 * 2. Each temperature will be an integer in the range [30, 100].
 */

#define minimumTemperature 30
#define maximumTemperature 100
#define possibleTemperaturesCount 71

#include <iostream>
